import React from "react";
import Header from "../components/Header";

function DebutantStar() {
  return (
    <div className="star">
      <i className="fa-solid fa-star lightYellow"></i>
      <i className="fa-solid fa-star darkYellow"></i>
      <i className="fa-solid fa-star darkYellow"></i>
    </div>
  );
}

function IntermediaireStar() {
  return (
    <div className="star">
      <i className="fa-solid fa-star lightYellow"></i>
      <i className="fa-solid fa-star lightYellow"></i>
      <i className="fa-solid fa-star darkYellow"></i>
    </div>
  );
}

function ProStar() {
  return (
    <div className="star">
      <i className="fa-solid fa-star lightYellow"></i>
      <i className="fa-solid fa-star lightYellow"></i>
      <i className="fa-solid fa-star lightYellow"></i>
    </div>
  );
}

const Competences = () => {
  return (
    <div>
      <Header />
      <div className="content-competences">
        <div className="competences-langages-experiences">
          <div className="competences-langages">
            <h1>Langages</h1>
            <div className="langages-item">
              <h3>HTML</h3>
              <i class="fa-brands fa-html5 logo"></i>
              <ProStar />
            </div>
            <div className="langages-item">
              <h3>CSS</h3>
              <i class="fa-brands fa-css3 logo"></i>
              <ProStar />
            </div>
            <div className="langages-item">
              <h3>Bootstrap</h3>
              <i class="fa-brands fa-bootstrap logo"></i>
              <ProStar />
            </div>
            <div className="langages-item">
              <h3>Sass</h3>
              <i class="fa-brands fa-sass logo"></i>
              <ProStar />
            </div>
            <div className="langages-item">
              <h3>Javascript</h3>
              <i class="fa-brands fa-js logo"></i>
              <IntermediaireStar />
            </div>
            <div className="langages-item">
              <h3>React JS</h3>
              <i class="fa-brands fa-react logo"></i>
              <IntermediaireStar />
            </div>
          </div>
          <div className="competences-experiences"></div>
        </div>
        <div className="competences-autres-interets">
          <div className="competences-autres"></div>
          <div className="competences-interets"></div>
        </div>
      </div>
    </div>
  );
};

export default Competences;
